// Filename - Main.jsx
import React from "react";
import objects from "../main-objects"

export default function Main() {
    const objElements = objects.map(object => (
        <img 
			key={object.id} 
			src={require(`../images/${object.url}`)} 
			alt={object.label} 
			className="main--image"
		/>
    ));

    return (
        <div className="main">
            {objElements}
        </div>
    );
}
